def random_alpha(a, b):
    return ''.join(choice(string.letters) for _ in range(randint(a, b)))

def build_seg(l,n,d,c):
    return pack("<I16s112s4096s",l,n,d,c)

responses = [
    "It's all just electrons.",
    "TOO MANY SECRETS",
    "It's a living.",
    "Mess with the best...",
    "You can't stop the signal, Mal.",
]

def xor(x,y):
    return x^y

class SIGSEGV(Actions):
    def start(self):
        #self.delay(100)
        val = reduce(lambda a,b: a ^ b, unpack("<IIII",self.magic_page[:16]))
        self.read(length=4, expect=pack("<I",val))
    def nottrusted(self):
        self.write(pack("<I",1))
        self.write(build_seg(4096,random_alpha(0,15),random_alpha(0,112),""))
        self.read(delim="\n",expect="fin.")
    def invalidseg(self):
        self.write(pack("<I",randint(11,2**32-1)))
        self.read(delim="\n",expect="Only the sigs deal in absolutes.")
    def valid(self):
        sel = randint(0,len(responses)-1)
        name = random_alpha(1,15)
        desc = random_alpha(1,111)

        self.write(pack("<I",1))
        self.write(build_seg(4096,name,desc,payloads[sel]))
        self.read(delim="\n",expect=name)
        self.read(delim="\n",expect=desc)
        self.read(delim="\n",expect=responses[sel])
        self.read(delim="\n",expect="fin.")



